import React from 'react';
import './App.css';

function App() {
  return (
    // This is JSX code which looks very similar to HTML.
    <div className="App">
      <header className="App-header">
        <p>
          Hello World
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
